provisions.content:
"Artículo único. Se autoriza el cambio de nombres de las calles de la comuna de Lautaro, que a continuación se expresan:
La actual calle "Matadero" se denominará "Manuel Juárez";
La actual calle "Cholchol" se denominará "Eduardo Jequier";
La actual calle "Nielol" se denominará "21 de Mayo";
La actual calle "Araucanía" se denominará "Ernesto Riquelme";
La actual calle "Hospital" se denominará "Martínez de Rozas";
La actual calle "Feria" se denominará "Camilo Henríquez";
La actual calle "Marilúan" se denominará "Hernán Trizano";
La actual calle "Las Industrias" se denominará "Manuel A. Matta";
La actual calle "Avenida Boletería" se denominará "Andrés Bello";
La actual Avenida "Lautaro" se denominará "Avenida Pedro Aguirre Cerda";
La actual calle "Cuyanquén" se denominará "Blanco Encalada";
La actual calle "Comercio" se denominará "Bernardo O'Higgins";
La actual calle "Ferrocarril" se denominará "Enrique Mac Iver";
La actual calle "Quinchol" o "Villla Alegre" se denominará "Diego Barros Arana";
La actual calle "Brasil" (ultra Cautín) se denominará " Baquedano";
La actual calle "Piscicultura" se denominará "Pedro León Gallo";
La actual calle "Rawsons" se denominará "José Victorino Lastarria";
La actual "Plaza de la Estación" se denominará "Plaza Montebruno";
La actual "Plaza Cuyanquén" se denominará "Plaza Condell".
